import React, { Component } from 'react'

 class DatePickerDialog extends Component {
  constructor(props){
    super(props);
    this.state = {
      dobText: '',
      dobDate: null,
      journeyText: '',
      journeyDate: null,
    }
  }
  render() {
    return (
      <div className="datepicker">
        <button onClick={this.OpenModalBox}>open modal</button>
      </div>
    )
  }
}
export default DatePickerDialog;
